import React from "react";
import { Container, Card } from "semantic-ui-react";
import "./style.css";

const Home = () => (
  <Container>
   <Card

    header='Elliot Baker'
    meta='Friend'
    description='Elliot is a sound engineer living in Nashville who enjoys playing guitar and hanging with his cat.'
  />
  </Container>
);

export default Home;
